INSERT INTO `faqs` (`id`, `question_en`, `question_ar`, `answer_en`, `answer_ar`, `created_at`, `updated_at`) VALUES
(1, 'when can I cancel my booking without penalities?', 'متى يمكنيي الغاء الحجز بدون غرامة؟', 'depends on your guest\'s terms and conditions.', 'يعتمد على سياسة المضيف', '2023-04-15 00:58:42', '2023-04-15 00:58:42'),
(2, 'Refunds on flight bookings', 'المبالغ المستردة على حجوزات الطيران', 'Due to COVID-19, most refunds for flights, including when they’re part of a package, are issued within 12 weeks. Some refunds could take a bit longer, depending on the airline.', 'بسبب COVID-19 ، يتم إصدار معظم المبالغ المستردة للرحلات الجوية ، بما في ذلك عندما تكون جزءًا من حزمة ، في غضون 12 أسبوعًا. قد تستغرق بعض المبالغ المستردة وقتًا أطول قليلاً ، اعتمادًا على شركة الطيران.', '2023-05-04 12:55:43', '2023-05-04 12:55:43'),
(3, 'How can I get more information about the room or property\'s facility?', 'كيف يمكنني الحصول على مزيد من المعلومات حول الغرفة أو مرفق العقار؟', 'You can find details about the property in your confirmation email or on the property detail page. For anything else, you can also contact property directly.', 'يمكنك العثور على تفاصيل حول العقار في رسالة التأكيد الإلكترونية الخاصة بك أو في صفحة تفاصيل العقار. لأي شيء آخر ، يمكنك أيضًا الاتصال بالعقار مباشرةً.', '2023-05-04 14:16:24', '2023-05-04 14:16:24'),
(4, 'Where can I check my booking details and status?', 'أين يمكنني التحقق من تفاصيل حجزي وحالته؟', 'You can always view your booking details and status online by signing in and selecting \"My bookings\" from the account menu. If you don\'t know your sign in details, you can follow the \"My bookings\" link in your confirmation email.', 'يمكنك دائمًا عرض تفاصيل الحجز والحالة عبر الإنترنت عن طريق تسجيل الدخول واختيار \"حجوزاتي\" من قائمة الحساب. إذا كنت لا تعرف تفاصيل تسجيل الدخول الخاصة بك ، يمكنك اتباع رابط \"حجوزاتي\" في رسالة التأكيد الإلكترونية الخاصة بك.', '2023-05-04 17:24:04', '2023-05-04 17:24:04');
