(6, '{\"en\":\"Jeddah is one of the most important tourist cities in Saudi Arabia, known for its stunning beaches, luxurious resorts, world-class restaurants, markets, and shopping centers.\\r\\n\\r\\nJeddah boasts a famous beach that stretches for over 30 kilometers, and is one of the most important tourist attractions in the city. The beach features numerous parks, restaurants, cafes, and recreational activities that cater to all ages.\",\"ar\":\"\\u062c\\u062f\\u0629 \\u0647\\u064a \\u0648\\u0627\\u062d\\u062f\\u0629 \\u0645\\u0646 \\u0623\\u0647\\u0645 \\u0627\\u0644\\u0645\\u062f\\u0646 \\u0627\\u0644\\u0633\\u064a\\u0627\\u062d\\u064a\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0645\\u0644\\u0643\\u0629 \\u0627\\u0644\\u0639\\u0631\\u0628\\u064a\\u0629 \\u0627\\u0644\\u0633\\u0639\\u0648\\u062f\\u064a\\u0629\\u060c \\u062d\\u064a\\u062b \\u062a\\u062a\\u0645\\u064a\\u0632 \\u0628\\u0634\\u0648\\u0627\\u0637\\u0626\\u0647\\u0627 \\u0627\\u0644\\u0631\\u0627\\u0626\\u0639\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0639\\u0627\\u062a \\u0627\\u0644\\u0641\\u0627\\u062e\\u0631\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0637\\u0627\\u0639\\u0645 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0623\\u0633\\u0648\\u0627\\u0642 \\u0648\\u0627\\u0644\\u0645\\u0631\\u0627\\u0643\\u0632 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629.\\r\\n\\u062a\\u062d\\u0638\\u0649 \\u062c\\u062f\\u0629 \\u0628\\u0634\\u0627\\u0637\\u0626\\u0647\\u0627 \\u0627\\u0644\\u0634\\u0647\\u064a\\u0631 \\u0627\\u0644\\u0630\\u064a \\u064a\\u0645\\u062a\\u062f \\u0644\\u0623\\u0643\\u062b\\u0631 \\u0645\\u0646 30 \\u0643\\u064a\\u0644\\u0648\\u0645\\u062a\\u0631\\u064b\\u0627\\u060c \\u0648\\u064a\\u0639\\u062f \\u0648\\u0627\\u062d\\u062f\\u064b\\u0627 \\u0645\\u0646 \\u0623\\u0647\\u0645 \\u0623\\u0645\\u0627\\u0643\\u0646 \\u0627\\u0644\\u062c\\u0630\\u0628 \\u0627\\u0644\\u0633\\u064a\\u0627\\u062d\\u064a \\u0641\\u064a \\u0627\\u0644\