(7, '{\"en\":\"Riyadh is known for its numerous cultural, sports, and entertainment events throughout the year, making it a unique tourist destination in Saudi Arabia. In addition to its historical and cultural landmarks, visitors can enjoy various activities such as sports events, concerts, festivals, and exhibitions. Riyadh also offers a wide range of shopping options, restaurants, and cafes, making it a vibrant and dynamic city that attracts visitors from all over the world.\",\"ar\":\"\\u062a\\u062a\\u0645\\u064a\\u0632 \\u0627\\u0644\\u0631\\u064a\\u0627\\u0636 \\u0628\\u0627\\u0644\\u0639\\u062f\\u064a\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0641\\u0639\\u0627\\u0644\\u064a\\u0627\\u062a \\u0627\\u0644\\u062b\\u0642\\u0627\\u0641\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0631\\u064a\\u0627\\u0636\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062a\\u0631\\u0641\\u064a\\u0647\\u064a\\u0629 \\u0637\\u0648\\u0627\\u0644 \\u0627\\u0644\\u0639\\u0627\\u0645\\u060c \\u0645\\u0645\\u0627 \\u064a\\u062c\\u0639\\u0644\\u0647\\u0627 \\u0648\\u062c\\u0647\\u0629 \\u0633\\u064a\\u0627\\u062d\\u064a\\u0629 \\u0645\\u0645\\u064a\\u0632\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0645\\u0644\\u0643\\u0629 \\u0627\\u0644\\u0639\\u0631\\u0628\\u064a\\u0629 \\u0627\\u0644\\u0633\\u0639\\u0648\\u062f\\u064a\\u0629. \\u0628\\u0627\\u0644\\u0625\\u0636\\u0627\\u0641\\u0629 \\u0625\\u0644\\u0649 \\u0645\\u0639\\u0627\\u0644\\u0645\\u0647\\u0627 \\u0627\\u0644\\u062a\\u0627\\u0631\\u064a\\u062e\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062b\\u0642\\u0627\\u0641\\u064a\\u0629\\u060c \\u064a\\u0645\\u0643\\u0646 \\u0644\\u0644\\u0632\\u0648\\u0627\\u0631 \\u0627\\u0644\\u0627\\u0633\\u062a\\u0645\\u062a\\u0627\\u0639 \\u0628\\u0627\\u0644\\u0639\\u062f\\u064a\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0623\\u0646\\u0634\\u0637\\u0629 \\u0645\\u062b\\u0644 \\u0627\\u0644\\u0641\\u0639\\u0627\\u0644\\u064a\\u0627\\u062a \\u0627\\u0644\\u0631\\u064a\\u0627\\u0636\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062d\\