INSERT INTO `units` (`id`, `code`, `title`, `description`, `size`, `coordinates`, `arrival_time`, `departure_time`, `price`, `bathrooms_number`, `bedrooms_number`, `status`, `activation`, `user_id`, `city_id`, `district_id`, `category_id`, `type_id`, `capacity_id`, `badge_id`, `person_id`, `created_at`, `updated_at`) VALUES
(7, '17007', 'الأندلس, 23326 جدة, المملكة العربية السعودية', 'يقع إيبيس جدة سيتي سنتر في جدة، على بُعد 3.6 كم من جدة مول، وهو مكان إقامة يضم مركزاً للياقة البدنية ومواقف خاصة للسيارات مجاناً وصالة مشتركة ومطعماً، كما يشمل الفندق المصنف 3 نجوم مسبحاً خارجياً وغرفاً مكيّفة مع خدمة الواي فاي مجاناً، حيث تحتوي جميعها على حمّام خاص، فيما يتميز مكان الإقامة بنادٍ للأطفال ومركز للأعمال وخدمة تخزين الأمتعة للضيوف.\r\n\r\nتشمل كل غرفة في الفندق مكتباً، وتوفر غرف الضيوف المتوفرة في إيبيس جدة سيتي سنتر تلفزيون بشاشة مسطحة مع قنوات الكابل وصندوق ودائع آمن.\r\n\r\nتتوفر وجبة الإفطار يومياً، وتشمل الخيارات بوفيه إفطار وإفطار كونتيننتال ووجبة إفطار أمريكية.\r\n\r\nيضم مكان الإقامة تراس للتشمس، ويمكن للضيوف لعب البلياردو في هذا الفندق المصنف 3 نجوم، كما تتوفر خدمة استئجار السيارات.\r\n\r\nيتحدث الموظفون في مكتب الاستقبال اللغتين العربية والإنجليزية.\r\n\r\nيقع إيبيس جدة سيتي سنتر على بُعد 7.1 كم من كورنيش جدة و8.9 كم من متحف بيت نصيف، ويعتبر مطار الملك عبد العزيز الدولي المطار الأقرب للفندق، حيث يبعد مسافة 15 كم.\r\n\r\nأحب الأزواج تحديدًا الموقع، وقيّموه 8.7 لرحلة لشخصين.\r\n\r\nإيبيس جدة سيتي سنتر يستقبل ضيوف Booking.com منذ 13 فبراير 2020.\r\nسلسلة الفنادق/ العلامة التجارية: إيبيس', 80, '{ \"lat\":\"21.552824753719328\", \"long\":\"39.174154406844494\" }', '12:00:00', '12:00:00', 4000, 1, 2, 1, 1, 522, 18, 1000, 2, 2, 1, 1, 3, '2023-04-01 16:15:41', '2023-04-01 16:15:41'),
(8, '17008', 'جدة حي النزهه الدور العاشر شقه 112', 'تقع هذه الشقة في مدينة جدة السعودية وتتميز بتصميم عصري وأنيق. تتألف الشقة من غرفة نوم واحدة وصالة واسعة ومطبخ مجهز بالكامل وحمام واحد. وتتميز الشقة بإطلالة رائعة على المدينة.\r\n\r\nتتميز الشقة بالعديد من المميزات الرائعة، بما في ذلك نظام التحكم بالحرارة والتكييف المركزي والحمام الفاخر. كما تتوفر خدمات الأمن والحراسة على مدار الساعة وخدمات الصيانة المتاحة في أي وقت.\r\n\r\nيتميز المبنى الذي تقع فيه الشقة بوجود مواقف للسيارات ومصعد ومنطقة لعب الأطفال. وتقع الشقة بالقرب من المراكز التجارية والمطاعم والمتاجر، مما يجعلها مكانًا مثاليًا للعيش والاستمتاع بالحياة في جدة.', 100, '{ \"lat\":\"21.765432188888888\", \"long\":\"39.174154406844494\" }', '12:00:00', '12:00:00', 3000, 2, 3, 1, 1, 522, 18, 2171, 1, 1, 4, 2, 1, '2023-04-02 00:39:52', '2023-04-02 00:39:52'),
(9, '17009', 'الرياض العليا', 'شقة مودرن', 35, '{ \"lat\":\"21.252824753719328\", \"long\":\"39.152749066844494\" }', '16:24:00', '16:24:00', 399, 3, 4, 1, 1, 499, 3, 2, 4, 2, 2, NULL, 1, '2023-04-13 16:32:04', '2023-04-13 21:10:50'),
(10, '17010', 'الرياض، حي لبن بجانب طريق مكة', 'شقة حديقة ذو طراز مودرن مطلة على وادي حنيفة الشمالي.', 290, '{ \"lat\":\"21.188888888888888\", \"long\":\"39.774154406844494\" }', '12:12:00', '12:16:00', 333, 4, 5, 1, 1, 522, 3, 1206, 2, 2, 1, 1, 3, '2023-04-13 21:20:32', '2023-04-13 21:20:32'),
(11, '17011', 'قرطبة الغربي - مقابل مسجد سعد', 'شقة مودرن ذات طابع عصري أنيق، بهوية الحاضر ايحاء الماضي.', 154, '{ \"lat\":\"21.194568888888888\", \"long\":\"39.926754406844494\" }', '14:00:00', '16:00:00', 760, 5, 2, 1, 1, 1, 3, 101, 3, 3, 4, 1, 2, '2023-04-18 18:32:37', '2023-04-18 18:33:18'),
