(15, '17015', 'Alneqaa District , Alshifa Raod, Taif Saudi Arabia', 'This low-key resort in a gated compound is 3 km from Arruddaf Park and 12 km from the Shubra Palace museum. The Ta\'if International Airport is 39 km away.', 1500, '{ \"lat\":\"21.2188851\", \"long\":\"40.4150911\" }', '21:00:00', '09:00:00', 1200, 5, 3, 1, 1, 9, 5, 715, 1, 6, 3, 1, 2, '2023-05-04 12:47:55', '2023-05-04 12:47:55'),
