(17, '17017', 'Shaden Resort', 'Shaden Resort features a hot tub and a hammam, as well as air-conditioned accommodation in Al Ula, 22 km from Madain Saleh Tombs. The luxury tent offers a spa experience, with its spa facilities, fitness room and steam room. The luxury tent has an outdoor swimming pool with a pool bar, as well as a sauna and a 24-hour front desk.', 1200, '{ \"lat\":\"26.6623073\", \"long\":\"37.9589816\" }', '09:00:00', '21:00:00', 400, 4, 3, 1, 1, 5, 199, 2516, 2, 6, 3, 1, 2, '2023-05-04 15:20:53', '2023-05-04 15:20:53'),
(18, '17018', 'Braira Al Ahsa', 'Located in Al Ahsa, Braira Al Ahsa offers 4-star accommodation with a bar. This 4-star hotel offers room service, a 24-hour front desk and free WiFi.', 1200, '{ \"lat\":\"25.3439228\", \"long\":\"49.5473139\" }', '21:00:00', '21:00:00', 400, 1, 4, 1, 1, 522, 3677, 8396, 1, 6, 3, 1, 1, '2023-05-04 15:49:15', '2023-05-04 15:55:16');
