(1, NULL, NULL, 'في حالة حجز إقامة مع وجبة إفطار خلال شهر رمضان المبارك، يرجى الملاحظة أنه سيتم تقديم الإفطار الصباحي الاعتيادي إذا لم يشر مكان الإقامة بوضوح إلى أنه سيقدم وجبة إفطار صوم رمضان المبارك.\r\n\r\nيتّخذ مكان الإقامة هذا حالياً إجراءات إضافية للحفاظ على السلامة والتعقيم، وذلك نظراً للوضع الحالي المتعلق بفيروس كورونا (كوفيد - 19).\r\n\r\nنظراً للوضع الحالي المتعلّق بفيروس كورونا (كوفيد - 19)، يلتزم مكان الإقامة هذا بإجراءات صارمة للحفاظ على التباعد المكاني.\r\n\r\nنظراً للوضع الحالي المتعلق بفيروس كورونا (كوفيد - 19)، يعد ارتاد كمامة إجبارياً في جميع المناطق الداخلية المشتركة.\r\n\r\nسيطلب من الضيوف عند تسجيل الوصول إظهار بطاقة هوية تحتوي على صورة شخصية وبطاقة ائتمان. يرجى ملاحظة أن جميع الطلبات الخاصة ستكون رهناً بالتوافر وقد تستلزم تكاليف إضافية.', 'يعتمد عدد أسرّة الأطفال المسموح به على الخيار الذي تحدده. يرجى التحقق من الخيار الذي حددته لمزيد من المعلومات.\r\n\r\nلا تتوفر الأسرّة الإضافية في مكان الإقامة هذا.\r\n\r\nجميع أسرّة الأطفال رهن بالتوافر.', 'تتباين سياسة إلغاء الحجز والدفع المسبق وفقاً لنوع مكان الإقامة المحجوز. يرجى إدخال تاريخ إقامتكم ومراجعة شروط الغرفة المطلوبة.', 'عند الحجز لأكثر من 7 غرف قد تنطبق سياسات مختلفة وملاحق إضافية.', 'سرعه غير محدوده', 7, '2023-04-01 16:15:41', '2023-04-01 17:44:20'),
